import React, { Component } from "react";
import "./pokedex.css";

var PokedexA = require('pokedex'),
pokedex = new PokedexA();

console.log( pokedex.pokemon()[0] );
// document.write( pokedex.pokemon()[0].name );
//document.write( <img src="pokedex.pokemon()[0].sprites.normal" /> );

pokedex[0] = "pokedex.pokemon()[0].sprites.normal";
pokedex[1] = "pokedex.pokemon()[1].sprites.normal";
pokedex[2] = "pokedex.pokemon()[2].sprites.normal";
pokedex[3] = "pokedex.pokemon()[3].sprites.normal";
pokedex[4] = "pokedex.pokemon()[4].sprites.normal";
pokedex[5] = "pokedex.pokemon()[5].sprites.normal";

function displayAllImages() {
// Here has to be some error!!! //
 for (i=0;i<pokedex.length;i++) {
    document.write(<img src=" + pokedex[0] " />);
}
}

export default class Pokedex extends Component {

    render() {
    return (

    <div>
        <div className="container">
            <div className="row">
            <h1 className="page title">Pokedex</h1>
            </div>
        </div>
            <table className="table">
    <thead className="thead-dark">
        <tr>
        <th scope="col">ID</th>
        <th scope="col">Name</th>
        <th scope="col">Last</th>
        <th scope="col">Handle</th>
        </tr>
    </thead>
    <tbody>
        <tr>
        <th scope="row">1</th>
        <td><script>displayAllImages();</script></td>
        <td>Otto</td>
        <td>@mdo</td>
        </tr>
        <tr>
        <th scope="row">2</th>
        <td>Jacob</td>
        <td>Thornton</td>
        <td>@fat</td>
        </tr>
        <tr>
        <th scope="row">3</th>
        <td>Larry</td>
        <td>the Bird</td>
        <td>@twitter</td>
        </tr>
    </tbody>
    </table>
</div>    

  );
}
}
